from docx import Document

# Create a new Word document
doc = Document()

# Add content to the resume
doc.add_heading(&#x27;Brooke Rayner&#x27;, 0)
doc.add_paragraph(&#x27;462 Lone Pine Road\nCanton, MS 39046\n(769) 289-9081\nbrookelynrayner99@gmail.com&#x27;)

doc.add_heading(&#x27;Objective&#x27;, level=1)
doc.add_paragraph(
    &quot;Hardworking and driven professional with hands-on leadership experience in retail and cleaning management. &quot;
    &quot;Proven ability to lead teams, manage store operations, and maintain high standards of service and cleanliness. &quot;
    &quot;Seeking an Assistant Manager position at Dollar General where I can apply my supervisory skills and strong work ethic &quot;
    &quot;to support store success and team performance.&quot;
)

doc.add_heading(&#x27;Professional Experience&#x27;, level=1)

doc.add_paragraph(
    &quot;Merry Maids – Team Captain\n&quot;
    &quot;Ridgeland, MS | April 2023 – March 15, 2025\n&quot;
    &quot;- Led cleaning crews across multiple job sites, acting as the main point of contact between staff and office management.\n&quot;
    &quot;- Trained and supervised new employees, assigned daily tasks, and ensured all jobs met strict quality standards.\n&quot;
    &quot;- Maintained schedules, addressed client concerns, and helped improve service efficiency.\n&quot;
    &quot;- Operated as a de facto manager in the field, handling client relationships and staff performance.&quot;
)

doc.add_paragraph(
    &quot;Foster’s Cleaning Services – Cleaning Technician\n&quot;
    &quot;Flowood, MS | April 2023 – October 2024\n&quot;
    &quot;- Provided detailed residential and commercial cleaning services with a focus on efficiency and precision.\n&quot;
    &quot;- Maintained consistent client satisfaction through professionalism and high cleaning standards.\n&quot;
    &quot;- Worked independently and in teams, adapting quickly to changing environments and tasks.&quot;
)

doc.add_paragraph(
    &quot;Marriott – Housekeeping Attendant\n&quot;
    &quot;Madison, MS | May 2022 – April 2023\n&quot;
    &quot;- Delivered top-quality room cleaning services to hotel guests, ensuring all rooms met cleanliness and presentation standards.\n&quot;
    &quot;- Collaborated with housekeeping team and supervisors to meet time-sensitive turnover deadlines.\n&quot;
    &quot;- Received positive feedback for speed, reliability, and attention to detail.&quot;
)

doc.add_paragraph(
    &quot;Dollar General – Key Holder / Lead Sales Associate\n&quot;
    &quot;Three Rivers, TX | January 2021 – February 2022\n&quot;
    &quot;- Held opening and closing responsibilities, including balancing registers, securing store, and handling daily cash drop-offs.\n&quot;
    &quot;- Trained new associates and provided guidance during shifts to maintain store performance and customer satisfaction.\n&quot;
    &quot;- Arranged and maintained clean, visually appealing merchandise displays to boost sales and highlight promotions.\n&quot;
    &quot;- Handled customer issues with professionalism and ensured store compliance with company standards.&quot;
)

doc.add_heading(&#x27;Skills&#x27;, level=1)
doc.add_paragraph(
    &quot;- Team leadership &amp; field management\n&quot;
    &quot;- Retail operations &amp; keyholder duties\n&quot;
    &quot;- Customer service &amp; conflict resolution\n&quot;
    &quot;- Training and supervision\n&quot;
    &quot;- Inventory management\n&quot;
    &quot;- Strong time management and reliability&quot;
)

doc.add_heading(&#x27;References&#x27;, level=1)
doc.add_paragraph(&quot;Available upon request.&quot;)

# Save the document
file_path = &quot;/mnt/data/Brooke_Rayner_Resume.docx&quot;
doc.save(file_path)

file_path

